import { createRoot } from 'react-dom/client';
import App from './App';
import { BrowserRouter as Router } from 'react-router-dom';

const rootElement = document.getElementById('root');
const root = createRoot(rootElement);

// üëáÔ∏è wrap App in Router

root.render(
	<Router>
		<App />
	</Router>
);
